import heapq 

# in heap, store (sum, i, j)

def solver(nums1, nums2, k): 
    l = len(nums1) 
    h = [(nums1[0] + nums2[0], 0, 0)] 
    res = [] 
    for i in range(k): 
        s, a, b = heapq.heappop(h)
        if a + 1 < l: 
            heapq.heappush(h, (nums1[a + 1] + nums2[b], a + 1, b))
        if b + 1 < len(nums2): 
            heapq.heappush(h, (nums1[a] + nums2[b + 1], a, b + 1))
        res.append([nums1[a], nums2[b]])
        if len(h) <= 0: 
            return res
    return res


